description:
Karenin (ambient cinematic baroque) is a project of Alexander Smakotin, a musician/composer from Izhevsk, Russia, and an active member of Archaeopteryx art collective.

Line-up:
Leo Zu: turntables, SFX, mastering;
Kseniya Gubina: vocals;
Alexander Gagarin: vocals (tracks 4, 10)
Alexander Smakotin: keyboards, SFX;
Alexey Prozorov: guitars;
Anton Kataev: clarinet, saxophone;
Maxim Yakovlev: drums;
Renat Ashrapov: bayan.

(C) 2012 Karenin, Leo Zu, http://kareninband.com/
